const innitState = {
    User: {
        UserName: "duc",
        Name: "Nguyễn Duy Đức",
        Phone: "0379439568",
        Email: "duc304@gmail.com",
        Password: "123",
        Role: "Admin",
        Avatar: "https://tinhte.vn/store/2016/10/3893837_1_1.jpg"
    }
}


const rootReducer = (state: any = innitState, action: any) => {
    switch (action.type) {
        case "Login": {
            return state
        }
        default:
            return state;
    }

}
export default rootReducer
